import React from 'react';
import classes from "./Post.module.css";

const Post = (props) => {
  return (
    <div className="item">
      <div>
        {props.message}
      </div>
      <div className={classes.likenumber}>
        {props.like}
      </div>
    </div>
  );
}

export default Post;
